import React from "react";
import { MDBContainer, MDBRow, MDBCol, MDBJumbotron, MDBIcon } from "mdbreact";
import MenuLink from "../components/menuLink";

const CSSPage = () => {
  return (
    <MDBContainer>
      <MDBRow>
        <MDBCol md="4" className="mx-auto">
          <MDBJumbotron className="mt-3">
            <h1>
              <MDBIcon icon="css3" brand className="green-text" /> People
            </h1>
            <ul className="list-unstyled example-components-list">

              <MenuLink to="/CSS/stuff" title="Stuff members" />
              <MenuLink to="/CSS/regStudents" title="Registered members" />
              <MenuLink to="/CSS/com" title="COM students" />
              <MenuLink to="/CSS/inf" title="INf students" />
              <MenuLink to="/CSS/net" title="NET students"  />

            </ul>
          </MDBJumbotron>
        </MDBCol>
      </MDBRow>
    </MDBContainer>
  );
}

export default CSSPage;
